import { Blob } from 'buffer';
import { promises as fs } from 'fs';

// Define a File-like class for Node.js
class File {
    constructor(parts, filename, properties) {
        this.blob = new Blob(parts, properties);
        this.name = filename;
        this.lastModified = properties.lastModified;
        this.size = this.blob.size;
        this.type = this.blob.type;
    }

    async arrayBuffer() {
        return this.blob.arrayBuffer();
    }

    stream() {
        return this.blob.stream();
    }

    async text() {
        return this.blob.text();
    }

    slice(start, end, contentType) {
        return this.blob.slice(start, end, contentType);
    }
}

export async function getFileFromBase64(base64String, fileName) {
    try {
        // Ensure the base64 string contains the prefix and is properly formatted
        if (!base64String.includes('base64,')) {
            throw new Error('Invalid base64 string');
        }

        // Split the base64 string to get the content and the MIME type
        const [prefix, imageBase64] = base64String.split(',');
        const mime = prefix.match(/:(.*?);/)[1];

        // Decode base64 string
        const byteCharacters = atob(imageBase64);

        // Create an ArrayBuffer and a view for the decoded string
        const buffer = new ArrayBuffer(byteCharacters.length);
        const view = new Uint8Array(buffer);

        // Fill the view with the decoded string's char codes
        for (let i = 0; i < byteCharacters.length; i++) {
            view[i] = byteCharacters.charCodeAt(i);
        }

        // Create a Blob from the buffer
        const blob = new Blob([buffer], { type: mime });

        // Return a File-like object
        const file = new File([blob], fileName, { lastModified: new Date().getTime(), type: mime });
        return file;
    } catch (error) {
        console.error('Error converting base64 string to file:', error);
        throw error;
    }
}

// Usage example:
const base64String = 'data:image/png;base64,';
const fileName = 'image.png';

(async () => {
    try {
        const file = await getFileFromBase64(base64String, fileName);
        // console.log('File:', file);
        // You can now use the file object
        // For example, save it to the filesystem if needed
        await fs.writeFile(file.name, Buffer.from(await file.arrayBuffer()));
    } catch (error) {
        console.error('Failed to convert base64 string to file:', error);
    }
})();
